import React from "react"; 

export default function Hero(props) {
    return (
        <section className="hero-section">
            <div className="cool-photo-container">
                <img src={props.image} style={props.image === './images/pretty-drops.jpg' && {alignSelf: 'flex-end'}} className="cool-photo" alt="cool"/>
            </div>
        </section>
    )
}
